import React from 'react';
import styles from './Header.module.css';

interface HeaderProps {
  onOpenModal: (modalType: string) => void;
}

const Header: React.FC<HeaderProps> = ({ onOpenModal }) => {
  return (
    <header className={styles.header}>
      <h1 className={styles.title}>Uñas Estéticas</h1>
      <nav>
        <ul className={styles.navList}>
          <li><button onClick={() => onOpenModal('services')} className={styles.navButton}>Servicios</button></li>
          <li><button onClick={() => onOpenModal('gallery')} className={styles.navButton}>Galería</button></li>
          <li><button onClick={() => onOpenModal('testimonials')} className={styles.navButton}>Testimonios</button></li>
          <li><button onClick={() => onOpenModal('contact')} className={styles.navButton}>Contacto</button></li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
